import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Test } from "./pages";

function App() {
  return (
    <BrowserRouter>
        <Header />

        <main>
          <Routes>
            <Route path="/" element={<HomePage />}></Route>
            <Route path="show-all" element={<ShowAllPage />}></Route>
            <Route path="search-games" element={<SearchPage />}></Route>
            <Route
              path="add-games"
              element={<AddEditOrDeleteGamePage />}
            ></Route>
          </Routes>
        </main>
      </BrowserRouter>
  );
}

export default App;
